webpackJsonp([0x615c3666e45b],{841:function(e,t){e.exports={data:{post:{id:"/home/travis/build/benmvp/benmvp.github.io/content/posts/2015-09-02--speaking-at-little-rock-tech-fest-2015/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-3165d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 35.30487804878049%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Little Rock Tech Fest 2015 banner"\n        title=""\n        src="/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-48538.png"\n        srcset="/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-bed0f.png 200w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-5fd34.png 400w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-48538.png 800w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-b70ec.png 1200w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-d134a.png 1600w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-3165d.png 1640w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I have been invited to speak at <a href="http://lrtechfest.com/">Little Rock Tech Fest 2015</a> on October 16th! My talk is entitled <a href="http://lrtechfest.com/speakerdetails#Ben-Ilegbodu"><em>Sugar &#x26; Spice and Everything nice about ES6</em></a>. It’ll be a recap of the <a href="/learning-es6-series/"><em>Learning ES6</em> series</a> I’ve been writing in detail about.</p>\n<p>If you’re going to to be in Little Rock, Arkansas around October 16, 2015, you should come by. It’s a free conference and you can <a href="https://www.eventbrite.com/e/little-rock-tech-fest-2015-tickets-18030509740">register</a> for it on Eventbrite! It’s the premier developer conference in Arkansas.</p>\n<p>I’m super excited about the conference because it’ll be my first professional speaking engagement at a conference. And I really like that the conference isn’t a huge web conference in San Francisco so I don’t have to worry about having a super-knowledgable audience with respect to ECMAScript 6. It won’t be too big, but it also isn’t too small either. Check out this <a href="https://vimeo.com/108535414">video from 2014</a>.</p>\n<p>I really want to get into speaking at conferences so this is the perfect opportunity to get my feet wet. I’ve submitted talks to many other conferences (in the Bay Area, US and other parts of the world!), but I haven’t heard back yet. However, once I speak at LR Tech Fest, I should have a video to show (aka my demo tape) so I’ll no longer be an <em>absolute</em> nobody.</p>\n<p>So blessed and thankful for this opportunity. Looking forward to God equipping me to give the best presentation on ES6 I can. Hopefully this is just the beginning! I’ll give an update once I’ve given the talk.</p>',fields:{slug:"/speaking-at-little-rock-tech-fest-2015/",prefix:"2015-09-02"},frontmatter:{title:"Speaking at Little Rock Tech Fest 2015!",subTitle:null,cover:{childImageSharp:{resize:{src:"/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-160fa.png"}}}}},author:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:'<p>Ben is a Christian, husband and father of 2 girls, with a dozen years of experience developing user interfaces for the Web. He currently is a Principal Frontend Engineer at Eventbrite on the Frontend Platform team, focused on improving their React-based design system and frontend infrastructure. Ben also enjoys playing basketball, DIY, watching movies, and <a href="https://twitter.com/benmvp">tweeting</a> / <a href="http://www.benmvp.com">blogging</a> about his experiences with new web technologies.</p>'},footnote:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>© Ben Ilegbodu 2018.</li>\n<li>Powered by <a href="https://www.gatsbyjs.org/">Gatsby</a> &#x26; <a href="https://reactjs.org">React</a> using <a href="https://github.com/greglobinski/gatsby-starter-personal-blog">gatsby-starter-personal-blog</a>.</li>\n</ul>'}},pathContext:{slug:"/speaking-at-little-rock-tech-fest-2015/"}}}});
